import { Circles } from 'react-loader-spinner';

const Loader = () => {
  return (
    <div className='loading' style={{justifyContent: 'center', alignItems: 'center', width: '100%', }}>
        <Circles color='grey'/>
    </div>
  )
}

export default Loader
